import React from "react";
import OpenItemWindows from "./OpenItemWindows";
import Table from "./Table";

// -------------------- Main Window --------------------
export default function MainWindow(props) {
  // sittings
  const title = props.title,
    items = props.items;

  

  return (
    <section>
      {/* title */}
      <h2>{title}</h2>
      {/* table list  */}
      {items
        ? items.map((item, key) => (
            <Table
              item={item}
              key={key}
              like={(like_data) => {
                props.like(like_data);
              }}
              openItem={(selected_item)=>{props.openItem(selected_item)}}
            />
          ))
        : console.log("loading")}
    </section>
  );
}
